import React from 'react'
import Content from './Content'

export default class MainContainer extends React.Component {

    state = {
        allMeals: [],
        randomMeal: [],
        sessionOrder: [],
        logged: false
    }

    logIn = () => {
        this.setState({logged: true})
    }

    componentDidMount(){
        fetch('http://localhost3000:/meals')
          .then(res => res.json())
          .then(data => console.log(data));
    }


    render() {
        console.log(this.state.logged)

        return (
            <Content key={"content"} logged={this.state.logged} logIn={this.logIn}/>

        )
    }

}
